import React from "react";
 
 
const Weather = (props) => (
	<div className="infoWeath">
      { props.city &&
        <div>
          <p>Weather in {props.city}, {props.country}:
          <br>Max temperature: {props.temp_max} °С
           Min temperature: {props.temp_min} °С
         
          </br><br>Sunrise: {props.sunrise}
          Sunset: {props.sunset}          </br><br>Cloudiness: {props.weather_description}
          Wind: {props.wind} m/s
          </br><br>Humidity: {props.clouds} %
          Pressure: {props.pressure} hpa</br></p>
        </div>
      }
      <p className="error">{ props.error }</p>
      </div> )
 
 
 
export default Weather;
